(async function(Scratch) {
    const variables = {};
    const blocks = [];
    const menus = [];


    if (!Scratch.extensions.unsandboxed) {
        alert("This extension needs to be unsandboxed to run!")
        return
    }

    function doSound(ab, cd, runtime) {
        const audioEngine = runtime.audioEngine;

        const fetchAsArrayBufferWithTimeout = (url) =>
            new Promise((resolve, reject) => {
                const xhr = new XMLHttpRequest();
                let timeout = setTimeout(() => {
                    xhr.abort();
                    reject(new Error("Timed out"));
                }, 5000);
                xhr.onload = () => {
                    clearTimeout(timeout);
                    if (xhr.status === 200) {
                        resolve(xhr.response);
                    } else {
                        reject(new Error(`HTTP error ${xhr.status} while fetching ${url}`));
                    }
                };
                xhr.onerror = () => {
                    clearTimeout(timeout);
                    reject(new Error(`Failed to request ${url}`));
                };
                xhr.responseType = "arraybuffer";
                xhr.open("GET", url);
                xhr.send();
            });

        const soundPlayerCache = new Map();

        const decodeSoundPlayer = async (url) => {
            const cached = soundPlayerCache.get(url);
            if (cached) {
                if (cached.sound) {
                    return cached.sound;
                }
                throw cached.error;
            }

            try {
                const arrayBuffer = await fetchAsArrayBufferWithTimeout(url);
                const soundPlayer = await audioEngine.decodeSoundPlayer({
                    data: {
                        buffer: arrayBuffer,
                    },
                });
                soundPlayerCache.set(url, {
                    sound: soundPlayer,
                    error: null,
                });
                return soundPlayer;
            } catch (e) {
                soundPlayerCache.set(url, {
                    sound: null,
                    error: e,
                });
                throw e;
            }
        };

        const playWithAudioEngine = async (url, target) => {
            const soundBank = target.sprite.soundBank;

            let soundPlayer;
            try {
                const originalSoundPlayer = await decodeSoundPlayer(url);
                soundPlayer = originalSoundPlayer.take();
            } catch (e) {
                console.warn(
                    "Could not fetch audio; falling back to primitive approach",
                    e
                );
                return false;
            }

            soundBank.addSoundPlayer(soundPlayer);
            await soundBank.playSound(target, soundPlayer.id);

            delete soundBank.soundPlayers[soundPlayer.id];
            soundBank.playerTargets.delete(soundPlayer.id);
            soundBank.soundEffects.delete(soundPlayer.id);

            return true;
        };

        const playWithAudioElement = (url, target) =>
            new Promise((resolve, reject) => {
                const mediaElement = new Audio(url);

                mediaElement.volume = target.volume / 100;

                mediaElement.onended = () => {
                    resolve();
                };
                mediaElement
                    .play()
                    .then(() => {
                        // Wait for onended
                    })
                    .catch((err) => {
                        reject(err);
                    });
            });

        const playSound = async (url, target) => {
            try {
                if (!(await Scratch.canFetch(url))) {
                    throw new Error(`Permission to fetch ${url} denied`);
                }

                const success = await playWithAudioEngine(url, target);
                if (!success) {
                    return await playWithAudioElement(url, target);
                }
            } catch (e) {
                console.warn(`All attempts to play ${url} failed`, e);
            }
        };

        playSound(ab, cd)
    }
    class Extension {
        getInfo() {
            return {
                "blockIconURI": "data:image/png;base64,",
                "id": "AmongUtilis",
                "name": "Among Utilis",
                "color1": "#ff0000",
                "color2": "#a80000",
                "tbShow": true,
                "blocks": blocks
            }
        }
    }
    blocks.push({
        opcode: `alert`,
        blockType: Scratch.BlockType.COMMAND,
        text: `Alert impostor`,
        arguments: {},
        disableMonitor: true
    });
    Extension.prototype[`alert`] = async (args, util) => {
        alert(variables['imposter'])
    };

    blocks.push({
        opcode: `add_crew`,
        blockType: Scratch.BlockType.COMMAND,
        text: `Add crewmate`,
        arguments: {},
        disableMonitor: true
    });
    Extension.prototype[`add_crew`] = async (args, util) => {
        variables['crewmates'] = (variables['crewmates'] + 1)
    };

    blocks.push({
        opcode: `crewmates`,
        blockType: Scratch.BlockType.REPORTER,
        text: `Crewmates`,
        arguments: {},
        disableMonitor: true
    });
    Extension.prototype[`crewmates`] = async (args, util) => {
        return variables['crewmates']
    };

    blocks.push({
        opcode: `delete_crew`,
        blockType: Scratch.BlockType.COMMAND,
        text: `Vote crewmate off ship`,
        arguments: {},
        disableMonitor: true
    });
    Extension.prototype[`delete_crew`] = async (args, util) => {
        variables['crewmates'] = (variables['crewmates'] + -1)
    };

    blocks.push({
        opcode: `pick`,
        blockType: Scratch.BlockType.COMMAND,
        text: `Pick impostor from 1 to 10`,
        arguments: {},
        disableMonitor: true
    });
    Extension.prototype[`pick`] = async (args, util) => {
        variables['imposter'] = Math.floor(Math.random() * (10 - 1 + 1) + 1)
        variables['cremates'] = 9
    };

    blocks.push({
        opcode: `add_imposta_name`,
        blockType: Scratch.BlockType.COMMAND,
        text: `Add "Sussy" to the end of impostor's name`,
        arguments: {},
        disableMonitor: true
    });
    Extension.prototype[`add_imposta_name`] = async (args, util) => {
        variables['impostor'] = (variables['impostor'] + 'Sussy')
    };

    blocks.push({
        opcode: `sus_name`,
        blockType: Scratch.BlockType.COMMAND,
        text: `Change imposter name to "Sus"`,
        arguments: {},
        disableMonitor: true
    });
    Extension.prototype[`sus_name`] = async (args, util) => {
        variables['imposter'] = 'Sus'
    };

    Scratch.extensions.register(new Extension());
})(Scratch);